import axios from 'axios'
import React, { useEffect } from 'react'

function Axiostutorial() {
    useEffect(()=>{
        axios.get("https://jsonplaceholder.typicode.com/users")
        .then((Response)=>{
            console.log(Response)
        })
    })
  return (
    <div>
      AxiosTutorial
    </div>
  )
}

export default Axiostutorial
